import './cnt.css';
import '../App.css';


const CntTest2 =() => {
    return(
        <div className="cnt_wrap">
                <div className="cnt">
                  <div className="cnt_tit">타이틀</div>
                  <div className="tit_line"></div>
                  <div className="cnt_sub_tit">서브타이틀</div>
                  <div className="cnt_sec">
                      ㅁㄴㅇㅁㄴㅇㅁㄴㅇ
                  </div>
                </div>
            </div>
    )
    
}

export default CntTest2;
